    public string GetName(bool isProp, int ItemID, int DrawableID, int TextureID, string Gender)
    {
        FashionItemLookup di = GetItemFast(isProp, ItemID, DrawableID, TextureID, Gender);
        if (di == null)
        {
            return "";
        }
        else if (di.Name == "NULL")
        {
            return "";
        }
        return di.Name;
    }
    public FashionItemLookup GetItemFast(bool isProp, int ItemID, int DrawableID, int TextureID, string Gender)
    {
        HashSet<FashionItemLookup> ListToCheck = GetProperList(isProp, ItemID, Gender);
        if(ListToCheck == null)
        {
            return null;
        }
        return ListToCheck.FirstOrDefault(x => x.DrawableID == DrawableID && x.TextureID == TextureID && (x.Gender == Gender || x.Gender == "U"));
    }

    public HashSet<FashionItemLookup> GetItemsFast(bool isProp, int ItemID, int DrawableID, string Gender)
    {
        HashSet<FashionItemLookup> ListToCheck = GetProperList(isProp, ItemID, Gender);
        if (ListToCheck == null)
        {
            return null;
        }
        return ListToCheck.Where(x => x.DrawableID == DrawableID && (x.Gender == Gender || x.Gender == "U")).ToHashSet();
    }

